    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Salinas River NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Salinas River NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, information about the
    management direction, current management programs, and strategies for implementation.
    Key planning issues include: water quality, contaminants, hazardous materials, safety,
    biological resources, and cultural resources.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
